(1, 'For a Longer Life and Happier Gut, Eat More Fiber', 'The scientific lowdown on fiber  |  Get more fiber  |  The verdict on fiber', 'It’s easy to get caught up in counting calories and grams of added sugars, fats, proteins, and carbs when you’re trying to eat well. But there’s one nutrient that too often gets thrown to the wayside: dietary fiber. Scientists have long known that eating fiber is good for health. Decades ago, Irish physician (and fiber enthusiast) Denis Burkitt proclaimed, “America is a constipated nation… if you pass small stools, you have to have large hospitals.” And yet, years later, many of us are still ignoring our fiber intake.&nbsp;<span>American adults are only eating an average of 15 grams of fiber on any given day, despite the daily recommendations from the&nbsp;<a href=\"http://www.eatright.org/resource/food/vitamins-and-supplements/types-of-vitamins-and-nutrients/ways-to-boost-fiber\" target=\"_blank\" rel=\"noopener noreferrer\">Academy of Nutrition and Dietetics</a>&nbsp;being:</span><ul><li>25 grams for women, or 21 grams if over 50 years old</li><li>38 grams for men, or 30 grams if over 50</li></ul><span>Recently, however, fiber has popped up in headlines thanks to people like journalist Megyn Kelly and model Molly Sims, who have both credited their physiques on mainlining roughage. And more importantly, new research has been shedding more light on&nbsp;how&nbsp;fiber helps our bodies. This nutrient has been linked to&nbsp;<a href=\"https://www.healthline.com/health/food-nutrition/how-much-fiber-per-day\" target=\"\" rel=\"\">fending off disease</a>&nbsp;and reducing the risk of a range of conditions, including&nbsp;<a href=\"http://onlinelibrary.wiley.com/doi/10.1111/jdi.12376/full\" target=\"_blank\" rel=\"noopener noreferrer\">type 2 diabetesTrusted Source</a>,&nbsp;<a href=\"http://www.cell.com/cell-reports/fulltext/S2211-1247(16)30630-1\" target=\"_blank\" rel=\"noopener noreferrer\">food allergiesTrusted Source</a>, and even&nbsp;<a href=\"http://ard.bmj.com/content/early/2017/05/04/annrheumdis-2016-210810\" target=\"_blank\" rel=\"noopener noreferrer\">knee arthritis</a>.&nbsp;</span><span>Star-studded endorsements aside, it’s not about eating a&nbsp;<a href=\"https://www.healthline.com/nutrition/22-high-fiber-foods\" target=\"\" rel=\"\">“high-fiber” diet</a>&nbsp;as much as it’s simply this: Eat more fiber. Fiber does more than contributing to weight loss and reducing the risk of disease.&nbsp;</span>Losing out on those recommended fiber grams per day may significantly change the way your gut functions. It could even make a difference between weight loss or none, and longer life or not.', 'admin-1', 1685923200, 1);

